Console.WriteLine(result.GetProperty("inputData").GetProperty("name").ToString());
Console.WriteLine(result.GetProperty("inputData").GetProperty("age").ToString());
Console.WriteLine(result.GetProperty("outputData").GetProperty("name").ToString());
Console.WriteLine(result.GetProperty("outputData").GetProperty("age").ToString());

